import * as React from 'react';
import { TextField } from '@material-ui/core';
import { Formik, Form} from 'formik';

interface Values {
    firstName: string;
    lastName: string;
    email: string;
    message: string; // This is not a large enough variable type but for now it'll do.
}


interface Props {
    onSubmit: (values: Values) => void; //Parameters



}

export const MkForm: React.FC<Props> = ({ onSubmit }) => {
    return (
        <Formik initialValues={{firstName: '', lastName: '', email: '', msg: ''}} onSubmit={(values) => {
            onSubmit(values);
            }}>
            {() => (
                <Form>
                    <TextField id="outlined-basic" label="First Name" name="firstName" variant="outlined"/>;
                </Form>
            )}
        </Formik>
    );
}
